syntax = "proto2";
package ukex; 
message klinehistoricaldata
{ 
    enum CONST
    {
        CMD = 110;
    }
    message Data
    {
        required	string  k0 = 1;
        required    string  k1 = 2;
        required    string  k2 = 3;
        required    string  k3 = 4;
        required    string  k4 = 5;
        required    string  k5 = 6;
    }
    repeated	Data data = 1;
    required    string	token = 2; 
}
